class Stack():

	def __init__(self):
		
		self.stack = []

	def push(self, item):
		
		self.stack.append(item)

	def pop(self):
		
		self.stack.pop()

	def top(self):
		
		return self.stack[-1]

 
def solution(height):

    length = len(height)
    Master = Stack()
    Master.push(0)

    for n in range(length):								#第n個當起點
    	
    	sub = Stack()
    	sub.push(0)

    	for j in range(n+1,length+1):					#從這個起點開始變長度找最大

    		subcase = (j-n)*min(height[n:j])

    		if subcase > sub.top():						#如果這個長方形比較大
    			sub.push(subcase)

    	if sub.top() > Master.top():					#更新最大的值
    		Master.pop()
    		Master.push(sub.top())
    
    return Master.top()





